import React, { useState } from "react";
import "./App.css";

interface Card {
  id: number;
  title: string;
  content: string;
}

const dummyData: Card[] = [
  { id: 1, title: "Card 1", content: "This is the content of card 1." },
  { id: 2, title: "Card 2", content: "This is the content of card 2." },
  { id: 3, title: "Card 3", content: "This is the content of card 3." },
];

const App: React.FC = () => {
  const [input, setInput] = useState<string>("");
  const [cards, setCards] = useState<Card[]>([]);

  const handleInputChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    setInput(e.target.value);
  };

  const generateCards = () => {
    // Simulating a backend response with dummy data
    setCards(dummyData);
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>Card Generator</h1>
        <input
          type="text"
          value={input}
          onChange={handleInputChange}
          placeholder="Enter some text"
        />
        <button onClick={generateCards}>Generate Cards</button>
        <div className="card-container">
          {cards.map((card) => (
            <div key={card.id} className="card">
              <h2>{card.title}</h2>
              <p>{card.content}</p>
            </div>
          ))}
        </div>
      </header>
    </div>
  );
};

export default App;
